 function rings(divId,Name,NameValue,OtherValue) {	 var myChart = echarts.init(document.getElementById(divId));		var labelTop = {	    normal : {	        label : {	            show : true,	            position : 'center',	            formatter : '{b}',	            textStyle: {	                baseline : 'bottom'	            }	        },	        labelLine : {	            show : false	        }	    }	};	var labelFromatter = {	    normal : {	        label : {	            formatter : function (params){	                return ((100-params.percent).toFixed(2)) + '%';	            },	            textStyle: {	                baseline : 'top'	            }	        }	    }	};	var labelBottom = {	    normal : {	        color: '#ccc',	        label : {	            show : true,	            position : 'center'	        },	        labelLine : {	            show : false	        }	    },	    emphasis: {	        color: 'rgba(0,0,0,0)'	    }	};	var radius = [40, 55];	option = {	    /*legend: {	        x : 'center',	        y : 'center',	        data:[	            'GoogleMaps'	        ]	    },*/	    	    series : [	        {	            type : 'pie',	            center : ['15%', '30%'],	            radius : radius,	            x: '0%', // for funnel	            itemStyle : labelFromatter,	            data : [	                {name:'other', value : OtherValue, itemStyle : labelBottom},	                {name:Name, value : NameValue, itemStyle : labelTop}	            ]	        }       	    ]	};	 myChart.setOption(option);                 }  function addXlfb(divId,data,callback){	 var mainId=divId;	 var ulId=mainId+"_ul";	 var liId=ulId+"_li";	 if($("#"+mainId).html() != "") {		 $("#"+mainId).empty();	 }	 $("#"+mainId).append("<ul id='"+ulId+"' ></ul>");	 var color=["#2ec7c9","#b6a2de","#ffb980"];	 	 $.callService('internalStuInfoService', 'stusOfNumsContrastStatistics', data, function(d) {			var list=d[0].eduList;			var allValue=0;			// var stuRate = 0;			for(var i=0;i<list.length;i++){				allValue+=list[i].COUNTS;			}			for(var i=1;i<=list.length;i++){				var liHtml="<li class='tongji'><a id='' href='javascript:hoverData("+list[i-1].EDU_ID +","+data[0] +","+i +");'>"+				"<h3 class='tongji_title'>"+list[i-1].EDUNAME+"</h3>"+				"<div class='tongji_tu2'>"+					"<p id='"+liId+"_"+i+"' style='width: 860px; height: 250px'></p>"+					"<h4 class='tongji_date' style='color:"+color[i]+";'>"+list[i-1].COUNTS+"</h4>"+					"<h5 class='tongji_name'>"+list[i-1].EDUNAME+"</h5>"+				"</div></a></li>";				$("#"+ulId).append(liHtml);				rings(liId+"_"+i,list[i-1].EDUNAME,list[i-1].COUNTS,allValue-list[i-1].COUNTS);			}			if(list && list.length>0){				callback.call(this,list[0].EDU_ID);			}		}); }   